output$insight_3b &lt;- renderUI({
  HTML("&lt;p&gt;&lt;strong&gt;Prediction:&lt;/strong&gt; &lt;To be Added&gt;.&lt;/p&gt;")
})

}

options(shiny.launch.browser = TRUE)
shinyApp(ui, server)







